export const ArrowIcon = ({
  direction,
  width,
  height
}: {
  direction: "top" | "right" | "bottom" | "left"
  width?: number
  height?: number
}) => {
  let rotateDeg

  switch (direction) {
    case "left":
      rotateDeg = 0
      break

    case "right":
      rotateDeg = 180
      break

    case "top":
      rotateDeg = 90
      break

    case "bottom":
      rotateDeg = 270
      break

    default:
      rotateDeg = 0
  }

  return (
    <svg
      style={{ transform: `rotate(${rotateDeg}deg)` }}
      width={width || "24"}
      height={height || "24"}
      viewBox="0 0 24 24"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        fill-rule="evenodd"
        clip-rule="evenodd"
        d="M7.29289 12.3537L13.5858 18.6466C13.9763 19.0371 14.6095 19.0371 15 18.6466C15.3905 18.256 15.3905 17.6229 15 17.2323L9.41421 11.6466L15 6.06077C15.3905 5.67025 15.3905 5.03708 15 4.64656C14.6095 4.25604 13.9763 4.25603 13.5858 4.64656L7.29289 10.9395C6.90237 11.33 6.90237 11.9631 7.29289 12.3537Z"
        fill="currentColor"
      />
    </svg>
  )
}

